r."}},{"kind":"books#volume","id":"7RVOEAAAQBAJ","etag":"M6DreyM2F/A","selfLink":"https://www.googleapis.com/books/v1/volumes/7RVOEAAAQBAJ","volumeInfo":{"title":"Dive Into Systems","subtitle":"A Gentle Introduction to Computer Systems","authors":["Suzanne J. Matthews","Tia Newhall","Kevin C. Webb"],"publisher":"No Starch Press","publishedDate":"2022-09-20","description":"Dive into Systems is a vivid introduction to computer organization, architecture, and operating systems that is already being used as a classroom textbook at more than 25 universities. This textbook is a crash course in the major hardware and software components of a modern computer system. Designed for use in a wide range of introductory-level computer science classes, it guides readers through the vertical slice of a computer so they can develop an understanding of the machine at various layers of abstraction. Early chapters begin with the basics of the C programming language often used in systems programming. Other topics explore the architecture of modern computers, the inner workings of operating systems, and the assembly languages that translate human-readable instructions into a binary representation that the computer understands. Later chapters explain how to optimize code for various architectures, how to implement parallel computing with shared memory, and how memory management works in multi-core CPUs. Accessible and easy to follow, the book uses images and hands-on exercise to break down complicated topics, including code examples that can be modified and executed.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781718501362"},{"type":"ISBN_10","identifier":"1718501366"}],"readingModes":{"text":false,"image":false},"pageCount":813,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.1.1.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"