Republic in June 2002."}},{"kind":"books#volume","id":"BRqAjOM0xhgC","etag":"qm2Mp2WFnkw","selfLink":"https://www.googleapis.com/books/v1/volumes/BRqAjOM0xhgC","volumeInfo":{"title":"Explorations in Computing","subtitle":"An Introduction to Computer Science","authors":["John S. Conery"],"publisher":"CRC Press","publishedDate":"2011-06-27","description":"Based on the author’s introductory course at the University of Oregon, Explorations in Computing: An Introduction to Computer Science focuses on the fundamental idea of computation and offers insight into how computation is used to solve a variety of interesting and important real-world problems. Taking an active learning approach, the text encourages students to explore computing ideas by running programs and testing them on different inputs. It also features illustrations by Phil Foglio, winner of the 2009 and 2010 Hugo Award for Best Graphic Novel. Classroom-Tested Material The first four chapters introduce key concepts, such as algorithms and scalability, and hone practical lab skills for creating and using objects. In the remaining chapters, the author covers \"divide and conquer\" as a problem solving strategy, the role of data structures, issues related to encoding data, computer architecture, random numbers, challenges for natural language processing, computer simulation, and genetic algorithms. Through a series of interactive projects in each chapter, students can experiment with one or more algorithms that illustrate the main topic. Requiring no prior experience with programming, these projects show students how algorithms provide computational solutions to real-world problems. Web Resource The book’s website at www.cs.uoregon.edu/eic presents numerous ancillaries. The lab manual offers step-by-step instructions for installing Ruby and the RubyLabs gem with Windows XP, Mac OS X, and Linux. The manual includes tips for editing programs and running commands in a terminal emulator. The site also provides online documentation of all the modules in the RubyLabs gem. Once the gem is installed, the documentation can be read locally by a web browser. After working through the in-depth examples in this textbook, students will gain a better overall understanding of what computer science is about and how computer scientists think about problems.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781439812631"},{"type":"ISBN_10","identifier":"1439812632"}],"readingModes":{"text":true,"image":true},"pageCount":392,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"0.1.2.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=BRqAjOM0xhgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=BRqAjOM0xhgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=BRqAjOM0xhgC&printsec=frontcover&dq=computer+science&hl=&cd=4&source=gbs_api","infoLink":"http://books.google.com/books?id=BRqAjOM0xhgC&dq=computer+science&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Explorations_in_Computing.html?hl=&id=BRqAjOM0xhgC"},"saleInfo":{"country":"US","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"US","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Explorations_in_Computing-sample-epub.acsm?id=BRqAjOM0xhgC&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Explorations_in_Computing-sample-pdf.acsm?id=BRqAjOM0xhgC&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"h